const w4 = @import("wasm4.zig");
const std = @import("std");

const Controller = @import("Controller.zig");
const Sound = @import("Sound.zig");

const Self = @This();
index: usize = 0,
seed: u64,
seed_text_buf: [14]u8 = "Seed:         ".*,
seed_text_len: u8 = 0,

pub fn init(seed: u64) Self {
    var res = Self{
        .seed = seed,
    };
    res.update_seed_text();

    return res;
}

pub fn update_seed_text(self: *Self) void {
    const offset = 5;
    self.seed_text_len = @intCast(std.fmt.formatIntBuf(
        self.seed_text_buf[offset..],
        self.seed,
        16,
        .upper,
        .{},
    ) + offset);
}

pub const Options = enum {
    @"New Game",
    @"Load Game",
};

const asFields = std.meta.fields(Options);

const ticky = Sound{
    .freq = .{
        .start = 900,
        .end = 700,
    },
    .adsr = .{
        .sustain = 4,
        .release = 4,
    },

    .volume = 20,
    .mode = w4.TONE_TRIANGLE,
};

pub fn update(self: *Self, controls: Controller) ?Options {
    if (self.index > 0 and controls.released.up) {
        self.index -= 1;
        ticky.play();
    } else if (self.index < asFields.len - 1 and controls.released.down) {
        self.index += 1;
        ticky.play();
    }

    if (controls.held.left) {
        self.seed -%= 1;
        self.update_seed_text();
    } else if (controls.held.right) {
        self.seed +%= 1;
        self.update_seed_text();
    }

    if (controls.released.x) {
        return @enumFromInt(self.index);
    }

    w4.DRAW_COLORS.* = 0x1234;
    w4.blit(&mainmenu, 0, 0, mainmenu_width, mainmenu_height, mainmenu_flags);

    w4.DRAW_COLORS.* = 0x01;
    w4.text("TO THE CORE", 80 - 44, 36);

    inline for (asFields, 0..) |efield, n| {
        if (n == self.index) {
            w4.DRAW_COLORS.* = 0x41;
        } else {
            w4.DRAW_COLORS.* = 0x01;
        }

        w4.text(efield.name, 80 - efield.name.len * 4, 110 + n * 10);
    }

    w4.DRAW_COLORS.* = 0x01;
    const seed_text = self.seed_text_buf[0..self.seed_text_len];
    const x = 80 - self.seed_text_len * 4;
    const y = 110 + asFields.len * 10;
    w4.text(seed_text, x, y);

    return null;
}

